import {ReactComponent as GithubIcon} from 'assets/img/github.svg';

function Navbar(){

    return (
        <header>
      <nav className='container'>
        <div>
          <h1>DsMovie</h1>
          <a href="https://github.com/0Guilhermino"></a>
            <div>
              <GithubIcon />
              <p>/0Guilhermino</p>
            </div>
        </div>
      </nav>

    </header>
    );
    
}

export default Navbar;
